const OrdinalCard = ({ ordinal }) => {
  return (
    <div className="max-w-sm rounded overflow-hidden shadow-lg m-4 p-4 bg-white">
      <div className="px-6 py-4">
        <div className="font-bold text-xl mb-2">Ordinal {ordinal.id}</div>
        <p className="text-gray-700 text-base">Value: {ordinal.value}</p>
        <p className="text-gray-600 text-sm">
          Description: {ordinal.description || "N/A"}
        </p>
      </div>
    </div>
  );
};

export default OrdinalCard;
